/** @format */

import React from "react";
import Maincontent from "../components/Maincontent";
import "../components/main.css";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import ResponsiveEmbed from "react-bootstrap/ResponsiveEmbed";
import hvr from "hover.css";
import Container from "react-bootstrap/Container";

function Videos(props) {
  return (
    <div>
      <Maincontent title={props.title} subTitle={props.subTitle} />
      <div className="videomagestyle"> </div>
      <Container fluid={true}>
        <Row className="justify-content-center">
          
          <Col xl={4} lg={4} md={6} sm={12} xs={12} className="text-center">
            <div>
              <ResponsiveEmbed
                aspectRatio="16by9"
                className="iframcustom hvr-grow"
              >
                <embed src="https://www.youtube.com/embed/YhPS1KYdxHs" />
              </ResponsiveEmbed>
              <h6 className="videotitlestyle">عنوان الفيديو</h6>
              <p className="videotextstyle">مختصر عن الفديو , ....</p>
            </div>
          </Col>
 




        </Row>
      </Container>
    </div>
  );
}

export default Videos;
